import { createSlice, createAsyncThunk } from '@reduxjs/toolkit';

const fetchBooks = createAsyncThunk(
  'book/fetchBooks',
  async (args, thunkAPI) => {}
);

const bookSlice = createSlice({
  name: 'book',
  initialState: { books: null },
  reducers: {},
});

export const bookReducer = bookSlice.reducer;
